import { useCallback, useEffect } from "react";
import useHomeState from "./useHomeState";

const getElectronAPI = () => {
  if (typeof window === "undefined") {
    return null;
  }

  return window.electronAPI ?? null;
};

/**
 * Houses every handler and side-effect the Home screen needs.
 * State comes from useHomeState so rendering code can stay declarative.
 */
const useHomeHandlers = () => {
  const {
    system,
    updateSystem,
    ipc,
    updateIpc,
    setIpcPayload,
    realtime,
    updateRealtime,
    notifications,
    updateNotifications,
    setNotificationTitle,
    setNotificationBody,
    directory,
    updateDirectory,
    setDirectorySearchQuery,
  } = useHomeState();

  const refreshHistory = useCallback(async () => {
    const electronAPI = getElectronAPI();
    if (!electronAPI?.getDemoHistory) {
      updateIpc({
        history: [],
        historyStatus: "IPC bridge not available outside Electron.",
        isRefreshing: false,
      });
      return;
    }

    updateIpc({
      isRefreshing: true,
      historyStatus: "Requesting message history from the main process...",
    });

    try {
      const history = await electronAPI.getDemoHistory();
      if (Array.isArray(history) && history.length > 0) {
        updateIpc({
          history,
          historyStatus: "Latest IPC calls captured inside the main process.",
        });
      } else {
        updateIpc({
          history: [],
          historyStatus:
            "No IPC history yet. Send a message to populate this list.",
        });
      }
    } catch (error) {
      console.error("IPC history request failed", error);
      updateIpc({
        historyStatus: "Failed to load IPC history.",
      });
    } finally {
      updateIpc({ isRefreshing: false });
    }
  }, [updateIpc]);

  useEffect(() => {
    let isMounted = true;
    let unsubscribeRealtime = null;
    const electronAPI = getElectronAPI();

    const markUnavailable = () => {
      updateSystem({
        info: null,
        message: "Not running inside Electron (try npm run dev or npm start).",
      });
      updateRealtime({
        status: "Realtime updates not available outside Electron.",
        snapshot: null,
      });
      updateNotifications({
        status: "Notifications not available outside Electron.",
        channel: "",
      });
      updateDirectory({
        status: "Directory browsing not available outside Electron.",
        tree: null,
        path: "",
        searchResults: [],
        searchStatus: "Directory search not available outside Electron.",
        searchQuery: "",
        isSearching: false,
        selectedEntry: null,
        previewStatus: "File preview not available outside Electron.",
        previewDataUrl: "",
        previewText: "",
        isLoadingPreview: false,
      });
    };

    if (!electronAPI) {
      markUnavailable();
      refreshHistory();
      return () => {
        isMounted = false;
      };
    }

    const loadSystemInfo = async () => {
      try {
        const info = await electronAPI.getSystemInfo();
        if (isMounted) {
          updateSystem({
            info,
            message: "Electron bridge online.",
          });
          updateNotifications({
            status: "Ready to send a desktop notification.",
          });
          updateDirectory({
            status: "Select a directory to explore.",
            searchStatus: "Enter text to search in the selected directory.",
            searchResults: [],
            searchQuery: "",
            isSearching: false,
            selectedEntry: null,
            previewStatus: "Select a file to preview.",
            previewDataUrl: "",
            previewText: "",
            isLoadingPreview: false,
          });
        }
      } catch (error) {
        console.error(error);
        if (isMounted) {
          updateSystem({
            message: "Failed to reach the main process.",
          });
        }
      }
    };

    const attachRealtimeSubscription = () => {
      if (!electronAPI.subscribeToRealtimeUpdates) {
        if (isMounted) {
          updateRealtime({
            status: "Realtime updates not available outside Electron.",
            snapshot: null,
          });
        }
        return;
      }

      if (isMounted) {
        updateRealtime({
          status: "Listening for realtime updates...",
        });
      }

      // 5. realtime
      unsubscribeRealtime = electronAPI.subscribeToRealtimeUpdates(
        (payload) => {
          if (!isMounted) {
            return;
          }
          
          updateRealtime({
            status: "Receiving realtime updates from the main process.",
            snapshot: payload,
          });
        },
      );
    };

    loadSystemInfo();
    refreshHistory();
    attachRealtimeSubscription();

    return () => {
      isMounted = false;
      if (typeof unsubscribeRealtime === "function") {
        unsubscribeRealtime();
      }
    };
  }, [
    refreshHistory,
    updateSystem,
    updateRealtime,
    updateNotifications,
    updateDirectory,
  ]);

  // useCallback(fun, deps[]) : deps 諛곗뿴 媛믪씠 蹂寃쎈맆 ?뚮쭔 ?⑥닔瑜??ъ깮?깊븳?? 硫붾え?댁젣?댁뀡?쇰줈 遺덊븘?뷀븳 ?몃뱾???ъ깮?깆쓣 留됰뒗??
  const handleSendDemoMessage = useCallback(
    async (event) => {
      event.preventDefault();

      const electronAPI = getElectronAPI();
      if (!electronAPI?.sendDemoMessage) {
        updateIpc({
          status: "IPC bridge not available outside Electron.",
        });
        return;
      }

      updateIpc({
        isSending: true,
        status: "Sending message to the main process...",
      });

      try {
        // request main process to send demo message
        const response = await electronAPI.sendDemoMessage(ipc.payload);
        updateIpc({
          response,
          status: "Reply received from the main process.",
        });
        await refreshHistory();
      } catch (error) {
        console.error("IPC demo failed", error);
        updateIpc({
          status: "Failed to reach the main process.",
        });
      } finally {
        updateIpc({ isSending: false });
      }
    },
    [ipc.payload, refreshHistory, updateIpc],
  );
  
  // useCallback(fun, deps[]) : deps 諛곗뿴 媛믪씠 蹂寃쎈맆 ?뚮쭔 ?⑥닔瑜??ъ깮?깊븳?? 硫붾え?댁젣?댁뀡?쇰줈 遺덊븘?뷀븳 ?몃뱾???ъ깮?깆쓣 留됰뒗??
  const handleSendNotification = useCallback(async () => {
    const electronAPI = getElectronAPI();
    // 釉뚮┸吏 ?곌껐 ?곹깭 ?뺤씤
    if (!electronAPI?.sendNotification) {
      updateNotifications({
        status: "Notifications not available outside Electron.",
      });
      return;
    }

    updateNotifications({
      isSending: true,
      status: "Requesting desktop notification from the main process...",
      channel: "",
    });

    try {
      const response = await electronAPI.sendNotification({
        title: notifications.title,
        body: notifications.body,
      });

      if (response?.shown) {
        updateNotifications({
          status: "Notification displayed successfully.",
          channel: response.channel || "",
        });
      } else {
        updateNotifications({
          status: "Notification could not be displayed.",
          channel: response?.channel || "",
        });
      }
    } catch (error) {
      console.error("Notification request failed", error);
      updateNotifications({
        status: "Failed to trigger a desktop notification.",
      });
    } finally {
      updateNotifications({ isSending: false });
    }
  }, [notifications.body, notifications.title, updateNotifications]);

  // Select directory 踰꾪듉 ?대┃!
  const handleBrowseDirectory = useCallback(async () => {
    const electronAPI = getElectronAPI();
    if (!electronAPI?.browseDirectory) {
      updateDirectory({
        status: "Directory browsing not available outside Electron.",
        selectedEntry: null,
        previewStatus: "File preview not available outside Electron.",
        previewDataUrl: "",
        previewText: "",
        isLoadingPreview: false,
      });
      return;
    }

    updateDirectory({
      isBrowsing: true,
      status: "Waiting for directory selection...",
      searchResults: [],
      selectedEntry: null,
      previewStatus: "Select a file to preview.",
      previewDataUrl: "",
      previewText: "",
      isLoadingPreview: false,
    });

    try {
      // after : const root = await buildDirectorySnapshot(targetPath);
      // (root = node) -> resutl 
      const result = await electronAPI.browseDirectory();

      if (!result || result.canceled) {
        updateDirectory({
          tree: null,
          status: "Directory selection canceled.",
          path: "",
          searchResults: [],
          searchStatus: "Directory selection canceled.",
          searchQuery: "",
          selectedEntry: null,
          previewStatus: "Select a file to preview.",
          previewDataUrl: "",
          previewText: "",
          isLoadingPreview: false,
        });
        return;
      }
      // result.root = node
      console.log("handleBrowerDirectory", result.root); // -----------------------
      
      
      if (result.root) {
        updateDirectory({
          // directory state
          tree: result.root,
          status: "Directory tree loaded.",
          // ?좏깮???붾젆?곕━瑜??곹깭??諛섏쁺??Search by name ?낅젰?먯꽌 ?쒖슜?쒕떎.
          // await electronAPI.searchDirectory(...) ?몄텧 ???쒖슜??path 媛믪쓣 以鍮꾪븳?? // path: directory.path,
          path: result.root.path || "", // ?? D:\?뚯뒪??A
          searchResults: [],
          searchStatus: "Enter text to search in the selected directory.",
          searchQuery: "",
          isSearching: false,
          selectedEntry: null,
          previewStatus: "Select a file to preview.",
          previewDataUrl: "",
          previewText: "",
          isLoadingPreview: false,
        });
      } else {
        updateDirectory({
          tree: null,
          status: "No directory data received.",
          searchResults: [],
          searchStatus: "No directory data received.",
          path: "",
          searchQuery: "",
          selectedEntry: null,
          previewStatus: "Select a file to preview.",
          previewDataUrl: "",
          previewText: "",
          isLoadingPreview: false,
        });
      }
    } catch (error) {
      console.error("Directory browse failed", error);
      updateDirectory({
        status: "Failed to browse directory.",
      });
    } finally {
      updateDirectory({ isBrowsing: false });
    }
  }, [updateDirectory]);

  // ?붾젆?곕━ 寃???몃뱾??
  const handleSearchDirectory = useCallback(async () => {
    const electronAPI = getElectronAPI();
    if (!electronAPI?.searchDirectory) {
      updateDirectory({
        searchStatus: "Directory search not available outside Electron.",
        selectedEntry: null,
        previewStatus: "File preview not available outside Electron.",
        previewDataUrl: "",
        previewText: "",
        isLoadingPreview: false,
      });
      return;
    }

    // directory.searchQuery??<form onSubmit={onSearch}> ?먮쫫???듯빐 ?꾨떖?섍퀬, value={searchQuery ?? ""}?먯꽌 媛?몄삩??
    if (!directory.path) {
      updateDirectory({
        searchStatus: "Select a directory first.",
        selectedEntry: null,
        previewStatus: "Select a directory first.",
        previewDataUrl: "",
        previewText: "",
        isLoadingPreview: false,
      });
      return;
    }

    const rawQuery = typeof directory.searchQuery === "string" ? directory.searchQuery : "";
    const trimmedQuery = rawQuery.trim();

    if (trimmedQuery.length === 0) {
      updateDirectory({
        searchStatus: "Enter a search term.",
        searchResults: [],
        searchQuery: "",
        selectedEntry: null,
        previewStatus: "Enter a search term to preview results.",
        previewDataUrl: "",
        previewText: "",
        isLoadingPreview: false,
      });
      return;
    }

    try {
      updateDirectory({
        isSearching: true,
        searchStatus: "Searching for matches...",
        searchQuery: trimmedQuery,
        selectedEntry: null,
        previewStatus: "Searching for matches...",
        previewDataUrl: "",
        previewText: "",
        isLoadingPreview: true,
      });
      /**
       * main.js
       * ipcMain.handle("filesystem:search-directory")?? ??u?? ??????
       * response = {
       *   matches,
       *   status:
       *     matches.length > 0
       *       ? `Found ${matches.length} item(s).`
       *       : "No matching files or folders found."
       * };
       */
      // ??? ?????? ???? ?? o??
      // * };
      // */
      // ??? ????? ?????? ???? ??u
      const response = await electronAPI.searchDirectory({
        // options = {}
        path: directory.path,
        query: trimmedQuery,
      });

      if (response?.error) {
        updateDirectory({
          searchStatus: response.status || "Failed to search the directory.",
          searchResults: [],
          selectedEntry: null,
          previewStatus: response.status || "Failed to search the directory.",
          previewDataUrl: "",
          previewText: "",
          isLoadingPreview: false,
        });
        // ??u ??? ??????? ???쩔? ???
        return;
      }
      // ??泥?寃곌낵 ???????
      // ??u ??? ??????? ???쩔? ???
      // directory state ???????
      const matches = Array.isArray(response?.matches)
        ? response.matches
        : [];
      updateDirectory({
        // directory state ???????
        searchResults: matches,
        searchStatus:
          response?.status || "Search complete.",
        selectedEntry: null,
        previewStatus:
          matches.length > 0
            ? "Select a file to preview."
            : "No matching files to preview.",
        previewDataUrl: "",
        previewText: "",
        isLoadingPreview: false,
      });
    } catch (error) {
      console.error("Directory search failed", error);
      updateDirectory({
        searchStatus: "Failed to search the directory.",
        searchResults: [],
        selectedEntry: null,
        previewStatus: "Failed to search the directory.",
        previewDataUrl: "",
        previewText: "",
        isLoadingPreview: false,
      });
    } finally {
      updateDirectory({ isSearching: false, isLoadingPreview: false });
    }
  }, [directory.path, directory.searchQuery, updateDirectory]);
  
  const handleSelectSearchResult = useCallback(
    async (entry) => {

      // <button onSelectResult(match)> = entry
      console.log("handleSelectSearchResult entry", entry);
      /**
       * entry
       * {
            "name": "오타니.png",
            "path": "D:\\스크린샷\\오타니.png",
            "type": "file",
            "size": 188862,
            "modified": "2025-11-04T07:59:03.482Z"
        }
       */
      if (!entry) {
        updateDirectory({
          selectedEntry: null,
          previewStatus: "Select a file to preview.",
          previewDataUrl: "",
          previewText: "",
          isLoadingPreview: false,
        });
        return;
      }

      if (entry.type === "directory") {
        updateDirectory({
          selectedEntry: entry,
          previewStatus: "Preview not available for directories.",
          previewDataUrl: "",
          previewText: "",
          isLoadingPreview: false,
        });
        return;
      }
        /**
       * entry
       * {
            "name": "오타니.png",
            "path": "D:\\스크린샷\\오타니.png",
            "type": "file",
            "size": 188862,
            "modified": "2025-11-04T07:59:03.482Z"
        }
       */
      const targetPath = entry.path;
      updateDirectory({
        selectedEntry: entry,
        previewStatus: "Loading preview...",
        previewDataUrl: "",
        previewText: "",
        isLoadingPreview: true,
      });

      const electronAPI = getElectronAPI();
      if (!electronAPI?.getFilePreview) {
        updateDirectory({
          previewStatus: "File preview not available outside Electron.",
          isLoadingPreview: false,
        });
        return;
      }

      try {
     
        const response = await electronAPI.getFilePreview({ path: targetPath });
        console.log("await electronAPI.getFilePreview response", response);
      
        
        if (directory.selectedEntry && directory.selectedEntry.path !== targetPath) {
          return;
        }
        if (response?.error) {
          updateDirectory({
            previewStatus: response.status || response.error || "Failed to load preview.",
            previewDataUrl: "",
            previewText: "",
            isLoadingPreview: false,
          });
          return;
        }

        // response.status , response.dataUrl 업데이트
        if (response?.kind === "image" && response?.dataUrl) {
          updateDirectory({
            previewStatus: response.status || "Image preview ready.",
            previewDataUrl: response.dataUrl,
            previewText: "",
            isLoadingPreview: false,
          });
          return;
        }

        // directory state :  preview 愿???낅뜲?댄듃
          /**
           * response
           * {
            "kind": "image",
            "status": "Image preview ready.",
            "dataUrl": "data:image/png;base64,",
            "byteLength": 188862
          }
         */
        updateDirectory({
          previewStatus:
            response?.status || "Preview not available for this file type.",
          previewDataUrl: "",
          previewText: "",
          isLoadingPreview: false,
        });
      } catch (error) {
        console.error("File preview request failed", error);
        updateDirectory({
          previewStatus: "Failed to load preview.",
          previewDataUrl: "",
          previewText: "",
          isLoadingPreview: false,
        });
      }
    },
    [directory.selectedEntry?.path, updateDirectory]
  );

  return {
    state: {
      system,
      ipc,
      realtime,
      notifications,
      directory,
    },
    actions: {
      setIpcPayload,
      setNotificationTitle,
      setNotificationBody,
      setDirectorySearchQuery,
    },
    handlers: {
      refreshHistory,
      handleSendDemoMessage,
      handleSendNotification,
      handleBrowseDirectory,
      handleSearchDirectory,
      handleSelectSearchResult,
    },
  };
};

export default useHomeHandlers;












